export const type = {
  SEND_DATA: 'SEND_DATA'
};

export function sendStudentData(studentID, studentPassword, studentMajor) {
  return{
    type: type.SEND_DATA,
    studentID,
    studentPassword,
    studentMajor,
  }
}
